import { Chrono } from "react-chrono";

function Formation() {
	const items = [
		{
			title: "May 1940",
			cardTitle: "Dunkirk",
			url: "http://www.history.com",
			cardSubtitle: "Men of the British Expeditionary Force (BEF) wade out to..",
			cardDetailedText: "Men of the British Expeditionary Force (BEF) wade out to..",
			media: {
				name: "dunkirk beach",
				source: {
					url: "/images/logo.png",
					type: "png",
				},
				type: "IMAGE",
			},
		},
		{
			title: "May 1940",
			cardTitle: "Dunkirk",
			url: "http://www.history.com",
			cardSubtitle: "Men of the British Expeditionary Force (BEF) wade out to..",
			cardDetailedText: "Men of the British Expeditionary Force (BEF) wade out to..",
		},
	];

	return (
		<div>
			<Chrono
				items={items}
				theme={{
					primary: "var(--green-2)",
					secondary: "var(--orange-2)",
					cardBgColor: "transparent",
					cardForeColor: "var(--white)",
					titleColor: "black",
				}}
				mode='VERTICAL_ALTERNATING'
				borderLessCards
				hideControls
				useReadMore={false}
				flipLayout
			/>
		</div>
	);
}

export default Formation;
